商品名：消臭力自動でシュパッと本体ロイヤルローズ<br>【商品説明】<br>●時間が来るたびシュパッと消臭！いつでもフレッシュな空間がつづきます。●暗くなるとセンサーが反応し、自動的にスプレーする回数を減らして節約します。●来客前などいつでも好きな時にワンプッシュでスプレーできます。●お好みの香りの強さに合わせてスプレーする間隔を３段階に調節できます。<br>使用方法用途など：<BR>(1)本体のフタを開ける。\n(2)電池をセットする。\n(3)スプレー缶を図のようにセットする。白い先端をチップははずさない。\n(4)本体のフタを閉める。\n(5)本体底辺の香り調節スイッチを好みの設定に合わせる。\n(6)かたく平らな場所に置く。<br><br>成分：<BR>香料、エタノール<br>使用上の注意：<BR>噴霧口に顔を近づけない。\nじゅうたん・マットなどの不安定な場所に置かない。<br>問い合わせ先：<BR>エステー株式会社　〒１６１‐８５４０　東京都新宿区下落合１‐４‐１０　お客様相談室　ＴＥＬ０１２０‐１４５‐２３０<br>原産国：ベトナム<br>ブランド：消臭力自動でシュパッと<BR>商品サイズ：78×170×85<br>JANコード：4901070125388<BR>cs：10<BR>商品カテゴリ： 芳香剤・消臭剤 ＞ 部屋用　(260000)<BR><br>JANコード:4901070125388<br><br><br>商品番号：101-51754<br><br><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
